{
  "ubx_message": {
    "name": "UBX-NAV-HPPOSECEF",
    "class_id": "0x01",
    "message_id": "0x13",
    "message_type": "periodic_polled",
    "payload_length": {
      "fixed": 28
    },
    "fields": [
      {
        "byte_offset": 0,
        "name": "version",
        "data_type": "U1",
        "fixed_value": 0,
        "description": "Message version (0x00 for this version)"
      },
      {
        "byte_offset": 1,
        "name": "reserved0",
        "data_type": {
          "array_of": "U1",
          "count": 3
        },
        "reserved": true,
        "description": "Reserved"
      },
      {
        "byte_offset": 4,
        "name": "iTOW",
        "data_type": "U4",
        "unit": "ms",
        "description": "GPS time of week of the navigation epoch. See the section iTOW timestamps in Integration manual for details."
      },
      {
        "byte_offset": 8,
        "name": "ecefx",
        "data_type": "I4",
        "unit": "cm",
        "description": "ECEF X coordinate"
      },
      {
        "byte_offset": 12,
        "name": "ecefY",
        "data_type": "I4",
        "unit": "cm",
        "description": "ECEF Y coordinate"
      },
      {
        "byte_offset": 16,
        "name": "ecefZ",
        "data_type": "I4",
        "unit": "cm",
        "description": "ECEF Z coordinate"
      },
      {
        "byte_offset": 20,
        "name": "ecefXHp",
        "data_type": "I1",
        "scale": {
          "raw": "0.1",
          "multiplier": 0.1
        },
        "unit": "mm",
        "description": "High precision component of ECEF X coordinate. Must be in the range of -99..+99. Precise coordinate in cm = ecefX + (ecefXHp * 1e-2)."
      },
      {
        "byte_offset": 21,
        "name": "ecefYHp",
        "data_type": "I1",
        "scale": {
          "raw": "0.1",
          "multiplier": 0.1
        },
        "unit": "mm",
        "description": "High precision component of ECEF Y coordinate. Must be in the range of -99..+99. Precise coordinate in cm = ecefY + (ecefYHp * 1e-2)."
      },
      {
        "byte_offset": 22,
        "name": "ecefZHp",
        "data_type": "I1",
        "scale": {
          "raw": "0.1",
          "multiplier": 0.1
        },
        "unit": "mm",
        "description": "High precision component of ECEF Z coordinate. Must be in the range of -99..+99. Precise coordinate in cm = ecefZ + (ecefZHp * 1e-2)."
      },
      {
        "byte_offset": 23,
        "name": "flags",
        "data_type": "X1",
        "description": "Additional flags",
        "bitfields": [
          {
            "name": "invalidEcef",
            "bits": 0,
            "description": "1 = Invalid ecefX, ecefY, ecefZ, ecefXHp, ecefYHp and ecefZHp"
          }
        ]
      },
      {
        "byte_offset": 24,
        "name": "pAcc",
        "data_type": "U4",
        "scale": {
          "raw": "0.1",
          "multiplier": 0.1
        },
        "unit": "mm",
        "description": "Position Accuracy Estimate"
      }
    ]
  }
}
